import React from "react";
import Nav from "./Nav";
import Footer from "./Footer";
import "../stylesheets/Home.scss";
import "../stylesheets/About.scss";

export default function About() {
  return (
    <div>
      <Nav />
      <div className="about--wrapper">
        <div className="about--text">
          <p className="about--text_p">Birte Spreuer wurde Mitte der 80er im fast schon ländlichen Neunkirchen geboren. Ihr Kommunikatiosdesignstudium verschlug sie in jungen Jahren nach Saarbrücken, wo sie in ihrem Atelier bunt und bold gestaltet, wie auch viel getanzt hat. Jetzt lebt sie in Amsterdam und widmet sich weiterhin dem Gestalten schöner Print Produkte, dem guten Leben und der Programmiersprache.</p>
        </div>
      </div>
      <Footer />
    </div>
  );
}
